const checkPrime=e=>{const r=Math.sqrt(e);for(let i=3;i<=r;i++){if(e%i===0)return false}return true};const isPrime=e=>{if(!Number.isInteger(e)||e<=2||e%2===0)return false;return checkPrime(e)};module.exports={isPrime:isPrime,findPrime:(...e)=>{const r=Array.from(new Set(e.filter(e=>Number.isInteger(e))));return r.map(e=>({number:e,isPrime:isPrime(e)}))}};